import React from "react";
import {emptyChatImage} from "../constants/data";
import {Box, Typography, styled} from "@mui/material";

const Component=styled(Box)`
background: #f8f9fa;
paading: 30px 0;
text-align: center;
height: 100%;
`



const EmptyChat=()=>{
    return (
       <Component>
            <Box>
                <img src={emptyChatImage} alt="image"></img>
                <Typography>WhatsApp Clone</Typography>
            </Box>
       </Component>
    );
}

export default EmptyChat;
